import React from 'react';
import './Admin.css';

export default function Admin() {
  return (
    <div style={{ padding: 24 }}>
      <h1>Admin Dashboard</h1>
      <p>This is a minimal admin page. Add management widgets here.</p>
      <div style={{ marginTop: 16 }}>
        <ul>
          <li><strong>Users:</strong> list and manage users</li>
          <li><strong>Bookings:</strong> view and cancel bookings</li>
          <li><strong>Airlines:</strong> manage flights and schedules</li>
          <li><strong>Support:</strong> view support tickets</li>
        </ul>
      </div>
    </div>
  );
}
